import React from 'react';
import "../../images/images";

const artcard = (props) => {

    let imgpath = {ImgFld} + (props.imagename) + '.jpg';
    return(
        <div className="artCard">
            <img src={imgpath}/>
            <h4>{props.name}</h4>
            <p>{props.description}</p>
            <p>{props.price}</p>
        </div>
    );
}

export default artcard;
